import "../css/Home.css"

const Home = () => {
    return ( 
        <div className="Home">
            <img src= "../images/homeBackground.jpg" alt="abstract background" className="Home-background"></img>
            <div className="Home-container">
                <h1> Welcome to QuizIt! </h1>
                <p className="p1"> All your study materials, all in one place. </p>
                <p className="p2"> Study flashcards by yourself or with friends, we don't care. </p>
                <button class="button-51">Log In</button>
                <button class="button-51">Sign Up</button>
            </div>
        </div>
    )
}

export default Home;
